INSERT INTO `cms_info` VALUES ('218', '3', '26', '亚运会即将在中国开幕', null, null, '<p>新华网阿斯塔纳6月9日消息，上海合作组织成员国元首理事会第十七次会议当日在哈萨克斯坦首都阿斯塔纳举行。国家主席习近平同哈萨克斯坦总统纳扎尔巴耶夫、吉尔吉斯斯坦总统阿坦巴耶夫、俄罗斯总统普京、塔吉克斯坦总统拉赫蒙、乌兹别克斯坦总统米尔济约耶夫出席会议。习近平在会上发表重要讲话，强调上海合作组织成员国要强化命运共同体意识，巩固团结协作，携手应对挑战，深化务实合作，拉紧人文纽带，坚持开放包容，携手创造本组织更加光明的未来。</p><p><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">当地时间9日上午11时50分许，习近平抵达独立宫，受到纳扎尔巴耶夫热情迎接。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">成员国元首先举行小范围会议，随后邀请观察员国阿富汗总统加尼、白俄罗斯总统卢卡申科、蒙古国总统额勒贝格道尔吉、印度总理莫迪、巴基斯坦总理谢里夫、伊朗外长扎里夫以及联合国秘书长古特雷斯等有关国际和地区组织代表参加大范围会议。纳扎尔巴耶夫主持会议。与会领导人分析了上海合作组织发展现状、任务和前景，就重大国际和地区问题交换意见，达成广泛共识。会议正式给予印度、巴基斯坦上海合作组织成员国地位。</span><strong style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; white-space: normal; background-color: rgb(255, 255, 255);\">会议决定，上海合作组织成员国元首理事会下次会议2018年在中国举行。下任主席国由中国担任。</strong><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">习近平在会上发表题为《团结协作 开放包容 建设安全稳定、发展繁荣的共同家园》的重要讲话。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">习近平指出，今年是《上海合作组织宪章》签署15周年，也是《上海合作组织成员国长期睦邻友好合作条约》签署10周年。成员国坚定遵循“上海精神”，树立了合作共赢的新型国际关系典范。中方愿同各方一道，强化命运共同体意识，建设安全稳定、发展繁荣的共同家园。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">习近平就上海合作组织发展提出5点建议。第一，巩固团结协作。要深化政治互信，加大相互支持，加强立法机构、政党、司法等领域交流合作，构建平等相待、守望相助、休戚与共、安危共担的命运共同体。中方倡议制定《上海合作组织成员国长期睦邻友好合作条约》未来5年实施纲要。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">第二，携手应对挑战。中方支持落实《上海合作组织反极端主义公约》，主张加强地区反恐怖机构建设，倡议举办防务安全论坛，</span><strong style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; white-space: normal; background-color: rgb(255, 255, 255);\">制定未来3年打击“三股势力”合作纲要。</strong><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">呼吁各方支持阿富汗和平和解进程，期待“上海合作组织－阿富汗联络组”为阿富汗和平重建事业发挥更积极作用。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">第三，深化务实合作。中方和有关各方正积极推动“一带一路”建设同欧亚经济联盟建设等区域合作倡议以及哈萨克斯坦“光明之路”等各国发展战略对接，上海合作组织可以为此发挥重要平台作用。中方倡议逐步建立区域经济合作制度性安排，支持建立地方合作机制，并积极开展中小企业合作。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">第四，拉紧人文纽带。中方愿同各方继续做好上海合作组织大学运行工作，办好青年交流营、中小学生夏令营，并主办上海合作组织国家文化艺术节等活动，启动实施“中国－上海合作组织人力资源开发合作计划”。</span><strong style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; white-space: normal; background-color: rgb(255, 255, 255);\">中方倡议建立媒体合作机制，将主办本组织首届媒体峰会。</strong><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">第五，坚持开放包容。中方支持上海合作组织同观察员国、对话伙伴以及其他国家开展合作，赞成本组织继续扩大同联合国等国际和地区组织的交流。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">习近平强调，中方将接任上海合作组织轮值主席国并于2018年6月举办峰会，将认真履职尽责，同各方携手创造本组织更加光明的未来。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">与会领导人一致同意，上海合作组织扩员将促进本组织发展、提升本组织潜力。应该以相互尊重、合作共赢、不冲突、不对抗、遵循国际法准则以及平等和不可分割安全、兼顾彼此利益等原则为基础，构建更加公正合理、符合各国共同利益及各自利益的多极世界格局，推动构建人类命运共同体。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">领导人重申恪守联合国宪章宗旨和原则，加大相互支持彼此维护国家独立、主权、领土完整等核心利益的努力，共同为巩固和平、维护全球安全稳定作出贡献。将加强协作，共同应对安全威胁与挑战，共同打击恐怖主义、分裂主义、极端主义。主张在恪守公认的国际法准则和原则基础上，采取政治外交手段解决地区冲突是唯一选择，不能容许以牺牲他国安全为代价维护自身安全。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">领导人欢迎“一带一路”倡议，高度评价今年5月在北京举行的“一带一路”国际合作高峰论坛成果，支持落实有关共识，推动区域经济合作。支持促进贸易和投资便利化，提升本地区互联互通能力，加强在基础设施建设、创新、金融、环保、科技、卫生、文化、教育、体育、旅游等领域合作。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">成员国元首签署了《上海合作组织成员国元首阿斯塔纳宣言》、《上海合作组织反极端主义公约》、《关于完成接收印度共和国加入上海合作组织程序并给予其上海合作组织成员国地位的决议》、《关于完成接收巴基斯坦伊斯兰共和国加入上海合作组织程序并给予其上海合作组织成员国地位的决议》、《关于给予印度共和国和巴基斯坦伊斯兰共和国上海合作组织成员国地位背景下上海合作组织成员国会费比例的决议》、《关于〈上海合作组织秘书长关于过去一年上海合作组织工作的报告〉的决议》、《关于〈上海合作组织地区反恐怖机构理事会关于地区反恐怖机构2016年工作的报告〉的决议》和《关于〈上海合作组织成员国常驻地区反恐怖机构代表条例〉的决议》等。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">会议发表了《上海合作组织成员国元首关于共同打击国际恐怖主义的声明》和《上海合作组织成员国元首理事会会议新闻公报》。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">会议后，习近平出席纳扎尔巴耶夫为出席会议的各国领导人以及国际和地区组织负责人举行的宴会。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">当晚，习近平同纳扎尔巴耶夫等各国领导人共同出席阿斯塔纳专项世博会开幕式并观看焰火表演。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">开幕式前，习近平同出席开幕式的各代表团团长集体参观阿斯塔纳专项世博会哈萨克斯坦国家馆“光明世界”。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">王沪宁、栗战书、杨洁篪等参加上述活动。</span><br/><strong style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; white-space: normal; background-color: rgb(255, 255, 255);\">习近平在上海合作组织成员国元首理事会第十七次会议上的讲话</strong><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">尊敬的纳扎尔巴耶夫总统，</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">尊敬的各位同事：</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">很高兴来到阿斯塔纳出席上海合作组织峰会。这座城市展现的生机活力是本组织蓬勃发展的生动写照。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">感谢东道主哈萨克斯坦和纳扎尔巴耶夫总统所作的精心准备和周到安排。一年来，哈方作为轮值主席国，做了大量卓有成效的工作，中方对此高度评价。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">今年是《上海合作组织宪章》签署15周年，也是《上海合作组织成员国长期睦邻友好合作条约》签署10周年。以这两份纲领性文件为思想基石和行动指南，成员国坚定遵循“上海精神”，在构建命运共同体道路上迈出日益坚实步伐，树立了合作共赢的新型国际关系典范。今天，我们将接收印度、巴基斯坦为成员国。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">当前，国际和地区形势深刻复杂变化，不稳定不确定因素增多。各国惟有同舟共济，才能妥善应对威胁和挑战。中方愿同各方一道，强化命运共同体意识，建设安全稳定、发展繁荣的共同家园。为此，我提出以下建议。</span><br/><strong style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; white-space: normal; background-color: rgb(255, 255, 255);\">第一，巩固团结协作。</strong><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">哈萨克斯坦有句谚语，“有团结的地方，定有幸福相随”。“上海精神”产生的强大凝聚力是本组织发展的保证。我们要保持团结协作的良好传统，新老成员国密切融合，深化政治互信，加大相互支持，构建平等相待、守望相助、休戚与共、安危共担的命运共同体。中方倡议制定《上海合作组织成员国长期睦邻友好合作条约》未来5年实施纲要，规划下一阶段各领域合作方向。建议加强立法机构、政党、司法等领域交流合作，为各方进行政策沟通提供渠道。</span><br/><strong style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; white-space: normal; background-color: rgb(255, 255, 255);\">第二，携手应对挑战。</strong><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">安全是发展的基石。没有安全，就谈不上发展。近期本地区发生的暴力恐怖事件表明，打击“三股势力”斗争仍然任重道远，我们要一如既往将维护地区安全稳定作为上海合作组织工作的优先方向。中方支持落实本次峰会将签署的《上海合作组织反极端主义公约》，有效遏制极端主义蔓延势头。为提升成员国在安全领域的协调水平和行动能力，中方主张加强地区反恐怖机构建设，严厉打击毒品制贩，愿再次主办上海合作组织网络反恐联合演习，倡议举办防务安全论坛，制定未来3年打击“三股势力”合作纲要。中方支持上海合作组织在国际和地区事务中发出一致声音，为推动热点问题政治解决贡献力量。中方对近期阿富汗安全形势恶化表示关切，呼吁各方支持阿富汗和平和解进程，期待“上海合作组织—阿富汗联络组”为阿富汗和平重建事业发挥更积极作用。</span><br/><strong style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; white-space: normal; background-color: rgb(255, 255, 255);\">第三，深化务实合作。</strong><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">地区一体化和经济全球化是时代潮流，各国和各国人民应该从这一进程中受益。上个月，“一带一路”国际合作高峰论坛在北京成功举行。中方和有关各方正积极推动“一带一路”建设同欧亚经济联盟建设等区域合作倡议以及哈萨克斯坦“光明之路”等各国发展战略对接，上海合作组织可以为此发挥重要平台作用。中方倡议逐步建立区域经济合作制度性安排，并从商签《上海合作组织贸易便利化协定》做起。为提高地区国家互联互通水平，中方支持按期开放《上海合作组织成员国政府间国际道路运输便利化协定》中规定的跨境线路，欢迎本地区其他国家加入协定，并赞同制定成员国公路协调发展规划。为调动更多资源和力量推动上海合作组织框架内务实合作，中方支持建立地方合作机制，并积极开展中小企业合作，倡议成立经济智库联盟和电子商务工商联盟。建议充分利用现有平台为本组织项目合作融资，同时在专家层面继续研究建立上海合作组织开发银行的可行方式。</span><br/><strong style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; white-space: normal; background-color: rgb(255, 255, 255);\">第四，拉紧人文纽带。</strong><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">我们要促进各国民众特别是青年一代心灵相通，使睦邻友好合作事业永葆活力。中方愿同各方一道，继续做好上海合作组织大学运行工作，办好青年交流营、中小学生夏令营等品牌项目，并主办上海合作组织国家文化艺术节、妇女论坛、职工技能大赛等活动，扎实推进卫生、救灾、环保、体育、旅游等领域合作。中方将启动实施“中国—上海合作组织人力资源开发合作计划”，通过邀请上海合作组织成员国人员来华研修研讨、派遣中方专家顾问赴成员国提供政策咨询、在成员国境内开展当地培训、提供政府奖学金名额等方式，加大同成员国在人力资源开发领域合作的广度和深度。促进民心相通，媒体不能缺位。中方倡议建立媒体合作机制，将主办本组织首届媒体峰会。</span><br/><strong style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; white-space: normal; background-color: rgb(255, 255, 255);\">第五，坚持开放包容。</strong><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">对外开放是本组织成立之初就确立的基本原则。中方支持上海合作组织同观察员国、对话伙伴以及其他国家开展多形式、宽领域合作，并根据有关规定和协商一致原则继续认真研究有关国家获得本组织法律地位的申请。中方赞成本组织继续扩大同联合国等国际和地区组织的交流合作，共同致力于促进世界持久和平和共同繁荣的事业。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">中方高度评价本组织两个常设机构的工作，决定向秘书处追加捐款1000万元人民币，用于改善工作条件和开展活动。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">各位同事！</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">本次峰会后，中方将接任上海合作组织轮值主席国并于2018年6月举办峰会。中方将认真履职尽责，同各方一道，努力给各国人民带来越来越多的获得感，携手创造本组织更加光明的未来。</span><br/><span style=\"color: rgb(51, 51, 51); font-family: &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, sans-serif; letter-spacing: 0.5px; line-height: 30px; background-color: rgb(255, 255, 255);\">谢谢大家。</span></p><p><br/></p>', null, '1', '2017-06-10 16:13:03', '1', null, null, '1000', '150', null, null, null, null, null);
